import React from 'react';
import './Button.css';
export default function Button(props){

    const show= ()=>{
        console.log(document.getElementsByClassName("btn"));
    }

   document.getElementsByClassName("btn").addEventListener('click',show);

    return(
        <>
            <div className="btn-layer">
                 <div className="btn" style={{color:`${props.color}`}}>{props.text1}</div>
                 <div className="btn" style={{color:`${props.color}`}}>{props.text2}</div>
                 <div className="btn" style={{color:`${props.color}`}}>{props.text3}</div>
                 <div className="btn" style={{color:`${props.colorText}`,backgroundColor:`${props.bg}`}}>{props.text4}</div>
            </div>
        </>
    )
}
